#!/bin/bash 

################################################################################
#huangjun @ 2015/11/02
# v01
################################################################################

pjp=`find tyd -name "$1"`
if [ -z "$pjp" ];then
	echo "not find A-project:$1"
	exit 1
fi
bproject=`echo $pjp | awk -F/ '{print $2}'`
dpj=d$1

mtkpj=`readlink vendor/droi/libs/$bproject`
if [ -z "$mtkpj" ] ;then
	bpjt=(`ls vendor/droi/libs/ | grep $bproject`)
	if [ -z "$2" ];then
		if [ ${#bpjt[@]} -eq 1 ];then
			bproject=${bpjt[0]}
		else
			echo "We find some project maybe the base project:"
			for bs in ${bpjt[@]}
			do
				echo " $bs"
			done
			echo -n "Which wanted:"
			read bproject
		fi
		mtkpj=`readlink vendor/droi/libs/$bproject`
		if [ -z "$mtkpj" ] ;then
			echo "Sorry can't get mtkbase project name."
			exit 1
		fi
	else
		mtkpj=$2
		if [ -z `echo ${bpjt[@]} |grep "\b$mtkpj\b"` ];then
			echo "Sorry,can't get mtkbase project named:$mtkpj"
			exit 1
		fi
	fi
fi
mtkpj=`echo $mtkpj | sed s/full_// | awk -F- '{print $1}'`

. build/envsetup.sh
createproject full_$mtkpj-eng droi $dpj

dpjp=droi_src/project/droi-$dpj
dcmn=droi_src/common
dconfitmk=$dpjp/config_mk

mkdir droi_tmp
tail -c 303104 $0 > droi_tmp/droimk_project_tempelete.tar
tar -xf droi_tmp/droimk_project_tempelete.tar -C droi_tmp
mv droi_tmp/project/droi-dx9/ droi_tmp/project/droi-$dpj

echo "common/* ===> $dcmn"
cp droi_tmp/common/* $dcmn -rf
echo "project/droi-$dpj/* ===> $dpjp"
cp droi_tmp/project/droi-$dpj/* $dpjp -rf
#exit

echo "$pjp/lk.mk ===> $dconfitmk/$dpj.mk"
cp $pjp/lk.mk $dconfitmk/$dpj.mk
sed -i "s^`cat $dconfitmk/$dpj.mk | grep TARGET`^TARGET := $dpj^g" $dconfitmk/$dpj.mk

echo "device/droi/$mtkpj/ProjectConfig.mk ===> $dconfitmk/"
cp -f device/droi/$mtkpj/ProjectConfig.mk $dconfitmk/
cat $pjp/ProjectConfig.mk >> $dconfitmk/ProjectConfig.mk

echo "$pjp/debug_defconfig $dpjp/kconfigs/${dpj}_debug_defconfig"
cp -f $pjp/debug_defconfig $dpjp/kconfigs/${dpj}_debug_defconfig
sed -i "s#`cat $dpjp/kconfigs/${dpj}_debug_defconfig | grep CONFIG_ARCH_MTK_PROJECT`#CONFIG_ARCH_MTK_PROJECT=\"$dpj\"#g" $dpjp/kconfigs/${dpj}_debug_defconfig
sed -i "s#`cat $dpjp/kconfigs/${dpj}_debug_defconfig | grep CONFIG_BUILD_ARM64_APPENDED_DTB_IMAGE_NAMES`#CONFIG_BUILD_ARM64_APPENDED_DTB_IMAGE_NAMES=\"$dpj\"#g" $dpjp/kconfigs/${dpj}_debug_defconfig

echo "$pjp/defconfig ===> $dpjp/kconfigs/${dpj}_defconfig"
cp -f $pjp/defconfig $dpjp/kconfigs/${dpj}_defconfig
sed -i "s#`cat $dpjp/kconfigs/${dpj}_defconfig | grep CONFIG_ARCH_MTK_PROJECT`#CONFIG_ARCH_MTK_PROJECT=\"$dpj\"#g" $dpjp/kconfigs/${dpj}_defconfig
sed -i "s#`cat $dpjp/kconfigs/${dpj}_defconfig | grep CONFIG_BUILD_ARM64_APPENDED_DTB_IMAGE_NAMES`#CONFIG_BUILD_ARM64_APPENDED_DTB_IMAGE_NAMES=\"$dpj\"#g" $dpjp/kconfigs/${dpj}_defconfig
echo "kernel-3.10/drivers/misc/mediatek/mach/mt6735/$bproject/dct/dct/codegen.dws ===> $dpjp/dws/codegen.dws"
cp -f kernel-3.10/drivers/misc/mediatek/mach/mt6735/$bproject/dct/dct/codegen.dws $dpjp/dws/codegen.dws

#mk
sed -i 's/#CUSTOM_MEMORY_HDR := $(MTK/CUSTOM_MEMORY_HDR := $(MTK/' bootable/bootloader/preloader/tools/emigen/emigen.mk
sed -i 's/^CUSTOM_MEMORY_HDR := $(D_R/#CUSTOM_MEMORY_HDR := $(D_R/' bootable/bootloader/preloader/tools/emigen/emigen.mk

rm -rf droi_tmp
echo "kernel-3.10/drivers/misc/mediatek/mach/mt6735/$bproject/* ===> kernel-3.10/drivers/misc/mediatek/mach/mt6735/$dpj"
cp -rf kernel-3.10/drivers/misc/mediatek/mach/mt6735/$bproject/* kernel-3.10/drivers/misc/mediatek/mach/mt6735/$dpj
echo "Done."
exit 0
